import "./App.css";
import { Main } from "./pages/Main";
import { useState } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom"; //라우팅

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Navigate to="profile" />} />
          <Route path="/main" element={<Main />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
